(function(e,t,n,r){r+='key='+t+'&user='+e+'&name='+encodeURIComponent(prompt('Bookmark name:',document.title))+'&url='+encodeURIComponent(location.href)+'&tags='+encodeURIComponent(prompt('Bookmark Tags:'));n.onload=function(){if(n.status>=200&&n.status<300)alert('Bookmark saved successfully');else{console.error(n.response);alert('Someting went wrong, check the console')}};n.open('GET',r,true);n.send(null)})('{user}','{key}',new XMLHttpRequest,'{root}')